import logo from './logo.svg';
import './App.css';
import {useState} from 'react';

function App() {
  const [inputValue, setInputValue] = useState('');

  const [outputValue, setOutputValue] = useState('Sample Text');

  const handleInputChange = (event) => {
    setInputValue(event.target.value);
  }

  const handleSubmit = () => {
    // Append the input value to the base URL
    const url = `https://dummyjson.com/${inputValue}`;

    // Perform a GET request to the constructed URL
    fetch(url)
    .then(response => response.json())
    .then(data => {
      // Update the read-only text box with the received data
      // Replace `data.someProperty` with the actual property you want to display

      setOutputValue(data.todos);
      console.log(outputValue)
    })
    .catch(error => console.error('Error:', error));
  }

  return (
    <div>
      <h2>Component A</h2>
      <input type="text" value={outputValue} readOnly />
      <input type="text" value={inputValue} onChange={handleInputChange} />
      <button onClick={handleSubmit}>Submit</button>
      <table border="1">
        <thead>
          <tr>
            <th>todo</th>
            <th>id</th>
            <th>completed</th>
            <th>userId</th>
          </tr>
            { outputValue.map((item)=>(
            <tr>
                <td>{item.id}</td>
                <td>col2_sample</td>
                <td>col2_sample</td>
               <td>col2_sample</td>
             </tr> 
          ))}

        </thead>
        <tbody>

        </tbody>
      </table>
    </div>
  );
}
export default App;
